import Vue from 'vue'
import VueRouter from 'vue-router'
import ResourcePage from '../views/ResourcePage.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    component: ResourcePage
  }
]

const router = new VueRouter({
  routes
})

export default router
